function Showcase() {
    const controls = useAnimation();
    const {ref, inView} = useInView({threshold: 0.35});
    useEffect(() => {
        if (inView) {
            controls.start("show");
        } else {
            controls.start("hidden");
        }
    }, [controls, inView]);
    useEffect(() => {
        setInterval(() => {
            cycleTitle();
        }, 2500);
    }, []);
    const [title, cycleTitle] = useCycle("DeFi", "NFT", "Gaming");
    return (
        <div className={styles.container}>
            <motion.div animate={controls}
                        initial="hidden"
                        variants={backgroundDisplay}>
                <motion.div animate={controls}
                            initial="hidden"
                            variants={backgroundOpacity}>
                    <svg className={styles.BGShape} viewBox="0 0 100 100"
                         fill="none"
                         xmlns="http://www.w3.org/2000/svg">
                        <rect width="100" height="100" fill="#3b00b9"/>
                    </svg>
                </motion.div>
            </motion.div>
            <motion.div
                ref={ref}
                animate={controls}
                initial="hidden"
                variants={container}
            >
                <div className={styles.showcaseContainer}>
                    <a id="showcase"/>
                    <div className={styles.header}>
                        <motion.div variants={item} className={styles.title}>
                            <span>Build for</span>
                            <div>
                                <AnimatePresence>
                                    <motion.span
                                        className={styles.textCycling}
                                        variants={textCycling}
                                        key={title}
                                        initial="enter"
                                        animate="center"
                                        exit="exit"
                                        transition={{
                                            y: {
                                                type: "spring",
                                                stiffness: 100,
                                                damping: 20,
                                                duration: 0.2
                                            },
                                            opacity: {duration: 0.1},
                                        }}
                                    >
                                        {title}
                                    </motion.span>
                                </AnimatePresence>
                            </div>
                        </motion.div>
                        <motion.div variants={item}
                                    className={styles.headerBody}>
                            <p className={styles.body}>The Internet Computer
                                ecosystem continues to skyrocket with new
                                developer and entrepreneurial activity. Get
                                inspired by the existing dapps.</p>
                            <Link className={styles.callToAction}
                                  to={"https://dfinity.org/showcase/"}>Explore
                                the
                                Internet
                                Computer ecosystem</Link>
                        </motion.div>
                    </div>
                    <motion.div variants={item} className={styles.cards}>
                        <Fleek/>
                        <HexGL/>
                        <Origyn/>
                        <Distrikt/>
                    </motion.div>
                    <motion.div variants={item}
                                className={styles.actionButtonContainer}>
                        <Link className={styles.actionButton} to="/samples">
                            BUILD YOUR OWN
                        </Link>
                    </motion.div>
                </div>
            </motion.div>
        </div>
    );
}

export default Showcase;
